import { Container } from 'react-bootstrap'

const ProductsSort = ({title = '', afterTitle = '', after = null}) => {
    return (
        <div className={c.pageHeader}>
            <Container>
                <div>
                    <h1 className={[title, 'h4'].join(' ')}>{title}{afterTitle ? <span> {afterTitle}</span> : null}</h1>
                    {after ? <div className={after}>{after}</div> : null}
                </div>
            </Container>
        </div>
    )
}

export default ProductsSort
